import React from 'react';
import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import Typography from '@material-ui/core/Typography';

export default function Header2(props) {

  const content = {
    'header': 'Get more out of your Apple Watch',
    'description': 'iHeartRate allows your apple watch to send and stores your beats per minute in to a database. The web application will then grab the heart rate information from the database and display it in a table in a graph. This way you can have more interaction with the information of the apple watch.',
    'primary-action': 'Sign up for free',
    'secondary-action': 'Read more',
  };

  const useStyles = makeStyles((theme) => ({
    signin: {
      width: "210px",
      height: "40px",
      cursor: "pointer",
      paddingLeft: "5px",
    },
    learnmore: {
      width: "210px",
      height: "40px",
      cursor: "pointer",
      color: "black",
      background: "white",
      fontFamily: 'sans-serif',
      textTransform: "none",
      borderRadius: '7px',
      '&:hover': {
        background: 'black',
        color: 'white',
      },   
    },
    learnmorefont: {
      fontSize: '18px',
      fontWeight: '500'
    }
  }
  ));
  const classes = useStyles();
  return (
    <section>
      <Container maxWidth="md">
        <Box py={8} textAlign="center">
          <Typography style={{fontFamily: '-apple-system-body, BlinkMacSystemFont, sans-serif', fontWeight: '100'}} variant="h3" component="h2" gutterBottom={true}>{content['header']}</Typography>
          <Typography style={{fontFamily: '-apple-system-body, BlinkMacSystemFont, sans-serif', fontWeight: '100'}} variant="h5" color="textSecondary" paragraph={true}>{content['description']}</Typography>
        </Box>
        <div id="appleid-signin" className={classes.signin} data-color="black" data-border="false" data-type="continue"></div>
            <script type="text/javascript" src="https://appleid.cdn-apple.com/appleauth/static/jsapi/appleid/1/en_US/appleid.auth.js"></script>
      </Container>
    </section>
  );
}
